import React, { Component } from 'react';
import { StyleSheet, View, Text } from 'react-native';

import * as firebase from "firebase/app";
import "firebase/firebase-database";
import firebaseConfig from '../src/config/fire';

import * as Font from 'expo-font';
import { Button, Container, Content, Header, Form, Input, Item, Label } from 'native-base';

export default class SetProfile extends Component {
    constructor(props) {
        super(props);
        this.state = {
            age: '',
            isReady: false
        };
    }

    async componentDidMount() {

        await Font.loadAsync({
            'Cafe24Ohsquare': require('../assets/fonts/Cafe24Ohsquare.ttf'),
            'Cafe24Ohsquareair': require('../assets/fonts/Cafe24Ohsquareair.ttf'),

        });

        this.setState({ isReady: true });
    }

    componentDidMount() {
        if (!firebase.apps.length) {
            firebase.initializeApp(firebaseConfig);
        }
    }

    render() {
        return (
            <Container styles={styles.container}>
                <Text styles={styles.title}>사용자 정보 입력</Text>
                <Form>
                    <Item floatingLabel>
                        <Label styles={{ fontFamily: 'Cafe24Ohsquareair' }}>나이</Label>
                        <Input
                            autoCompleteType="cc-number"
                            autoCorrect={false}
                            onChangeText>
                        </Input>
                    </Item>
                </Form>
            </Container>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    title: {
        FontFamily: 'Cafe24Ohsquareair',
        fontSize: 30,
        textAlign: 'center',
        justifyContent: 'center'
    }
})
